B.Fs=new A.ff("Motivaci\xf3n","Se necesita mucho coraje para llevar un negocio o cumplir con todos los objetivos del d\xeda a d\xeda. Es por eso que cuento mi trayectoria para inspirar y dar el ejemplo de que S\xcd es posible.",null)
B.Ft=new A.ff("Casos especializados","Imaginemos que eres una empresa de Seguros y quieres ejemplos de c\xf3mo hacer publicidad. Pues entonces: manos a la obra, expondr\xe9 temas y casos en los que entiendan y les sirvan para poder implementarlos en su d\xeda a d\xeda.",null)
B.Fx=new A.ff("Preguntas frecuentes","\xbfC\xf3mo funciona el proceso para agendar la fecha?\nEscr\xedbeme a hola@jpdirector.net para chequear si ese d\xeda  est\xe1 disponible, si es el caso,  puedes hacer un pago de dos partes 50% del precio de la conferencia y el otro 50% debe ser cancelado cinco d\xedas antes del evento.\n\n\xbfPuedes asistir a cualquier estado dentro de los Estados Unidos?\nClaro, solo debemos coordinar los boletos de avi\xf3n, hospedaje y vi\xe1ticos.",null)
